
DROP TABLE IF EXISTS CASTING ;
DROP TABLE IF EXISTS MOVIE ;
DROP TABLE IF EXISTS ACTOR ;
DROP TABLE IF EXISTS COLOURTYPE ; 
DROP TABLE IF EXISTS RATING ;

CREATE TABLE RATING  (
  RATINGCODE   VARCHAR(2) 
, SHORTDESC    VARCHAR(30) 
, LONGDESC     VARCHAR(100) 
, PRIMARY KEY  (RATINGCODE) 
);


CREATE TABLE COLOURTYPE  (
  COLOURCODE   VARCHAR(1) 
, COLOURNAME   VARCHAR(30) 
, PRIMARY KEY  (COLOURCODE) 
);


CREATE TABLE MOVIE  (
  MOVIENO      INTEGER(8) PRIMARY KEY  
, TITLE        VARCHAR(100) 
, RELYEAR      INTEGER(4) 
, RUNTIME      INTEGER(4) 
, RATINGCODE   VARCHAR(2) 
, COLOURCODE   VARCHAR(1) 
, TMDB_SCORE   DECIMAL(3,1) 
, TMDB_VOTES   INTEGER 
, TMDB_ID      VARCHAR(12) 
, FOREIGN KEY(RATINGCODE) references RATING(RATINGCODE)
, FOREIGN KEY(COLOURCODE) references COLOURTYPE(COLOURCODE)
);

CREATE TABLE ACTOR 
(
  ACTORNO    INTEGER(8)
, FULLNAME   VARCHAR(100)
, GIVENNAME VARCHAR(100)
, SURNAME    VARCHAR(100)
, GENDER     VARCHAR(1)
, BIRTHDATE  DATE
, IMDBID     VARCHAR(20)
, BIRTHCOUNTRY     VARCHAR(50)
, PRIMARY KEY (ACTORNO)
);

CREATE TABLE CASTING  (
  CASTID INTEGER(8)
, ACTORNO INTEGER(8)
, MOVIENO INTEGER(8)
, PRIMARY KEY (CASTID)
, FOREIGN KEY (ACTORNO) references ACTOR(ACTORNO) 
, FOREIGN KEY (MOVIENO) references MOVIE(MOVIENO) 
);



















